import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    { title: "Car Insurance", amount: 294.67, date: new Date(2024, 1, 28) },
    { title: "Home Insurance", amount: 296.67, date: new Date(2024, 1, 27) },
    { title: "Bike Insurance", amount: 297.67, date: new Date(2024, 1, 26) },
    { title: "Life Insurance", amount: 298.67, date: new Date(2024, 1, 25) },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem expense={expenses[0]}></ExpenseItem>
      <ExpenseItem
        title={expenses[0].title}
        price={expenses[0].amount}
        date={expenses[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[1].title}
        price={expenses[1].amount}
        date={expenses[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[2].title}
        price={expenses[2].amount}
        date={expenses[2].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[3].title}
        price={expenses[3].amount}
        date={expenses[3].date}
      ></ExpenseItem>
    </div>
  );
}

export default App;
